import Tooltip from "./components/Tooltip/Tooltip";

function App() {
  return (
    <div className="App">
      <Tooltip
        content="test tooltip"
        direction="left"
        style={{ color: "red", background: "#ccc" }}
      >
        <h2>Tooltip</h2>
      </Tooltip>
    </div>
  );
}

export default App;
